import React from "react";
import { Link } from "react-router-dom";


function Header(props) {
    return (
        <header className="header">
            <div className="header__logo"></div>
            <div className="header__link">
                <Link to='/movies' className="header__movies">{props.title}</Link>
                <Link to='/saved-movies' className="header__movies header__movies_saved">{props.subtitle}</Link>
            </div>
            <div className="header__info">
                <Link to='/signup' className="header__login">{props.logIn}</Link>
                <Link to='/signin'><button  className="header__button">{props.titleButton}</button></Link>
            </div>
        </header>

    );
}

export default Header;
